import React from 'react';

import Banner from './elements/banner';

import TextArea from './elements/textarea';

import ButtonArea from './elements/buttonarea';

import WholeWrap from './elements/wholewrap';

function Elements() {
  return (
    <react-fragment> 
        <Banner/>
        <TextArea/>
        <ButtonArea/>
        <WholeWrap />
    </react-fragment>
  );
}

export default Elements;
